package PrototypePattern;public class Param {    private Integer age;    private String name;    public Param(Integer age, String name) {        this.age = age;        this.name = name;    }    public Integer getAge() {        return age;    }    public void setAge(Integer age) {        this.age = age;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }}